$(document).ready(function(){
	AOS.init({
		offset: 15,
		duration: 400,
		once: false,
		mirror: false,
		easing: 'ease-out-quart',
		anchorPlacement: 'top-bottom',
		disable: function(){
			return ($(window).outerWidth() > 1200) ? false : true
		}
	});
	AOS.refresh();
	$.fn.setCursorPosition = function(pos) {
	  if ($(this).get(0).setSelectionRange) {
		$(this).get(0).setSelectionRange(pos, pos);
	  } else if ($(this).get(0).createTextRange) {
		var range = $(this).get(0).createTextRange();
		range.collapse(true);
		range.moveEnd('character', pos);
		range.moveStart('character', pos);
		range.select();
	  }
	};
	$.validator.setDefaults({
	   onfocusout: false,
	   validClass: "valid",
	   errorClass: "invalid",
	   errorPlacement: function(error,element) {
		  return true;
	   }
	});
	$('form').each(function(){
		$(this).validate({
		  submitHandler: function(form) {
			  $.ajax({
				  type		: "POST",
				  data		: $(form).serialize() + '&url=' + window.location.href + '&title=' + document.title,
				  url		  : window.wp_data.ajax_url,
				  success	: function(request) {
					  if(request.success === true) {
								console.log(request.data);
								$(form).trigger('reset').data('validator').resetForm();
					  } else {
						  console.log(request.data);
					  }
				  }
			  });
		  }
	   })
	})
	$("input[type='tel']").click(function(){
		$(this).setCursorPosition(6);
	}).mask("+375 (99) 999-99-99");
	$("input[type='tel']").mask("+375 (99) 999-99-99");
	function moveup() {
		if ($(document).scrollTop() > 1000) {
			$(".moveup").fadeIn();
		} else {
			$(".moveup").fadeOut();
		}
	}
	$(window).on('load scroll',function() {
		moveup();
	});
	$('.action[href="#request"]').on('click',function(event){
		event.preventDefault();
		var $this 	  = $(this),
			  subject   = $this.attr('data-subject');
				direction = $this.attr('data-direction');
		$('html').addClass('scroll-hidden');
		$('.fb_modal').removeClass('off').addClass('on');
		$(".fb_modal__form").find("input[name='subject']").val(subject);
		$(".fb_modal__form").find("input[name='direction']").val(direction);
		console.log('Тема: ' + subject);
		console.log('Направление: ' + direction);
	});
	$("a[href='#up']").on('click', function(event) {
		if (this.hash !== "") {
			event.preventDefault();
			var hash = this.hash;
			$('html, body').animate({
				scrollTop: $(hash).offset().top
			}, 800);
		}
	});
	$('.data-pluses .item .img').click(function() {
		$('.data-pluses .item').removeClass('active');
		$(this).parent().addClass('active');
		var content = $('.data-pluses .content'),
				hidden  = $(this).parent().find('.hidden');
		var clone = $(hidden).children().clone();
		$(content.find('.group-btns')).before(clone);
		$(clone).replaceWith(content.find('.group-btns').prevAll());
	})
	$('.data-pluses .item:nth-child(4) .img').click();
	$('.data-tab dt').click(function(){
		$(this).parent().children('dt').removeClass('active');
		$(this).addClass('active');
		$(this).parent().children('dd').hide();
		$(this).next('dd').show();
	});
	$('.action').click(function(event){
		var id = $(this).attr('href');
		$('html').addClass('scroll-hidden');
		$(id).removeClass('off').addClass('on');
	})
	$('.sidebar .close').click(function(){
		$(this).parent().removeClass('on').addClass('off');
		$('html').removeClass('scroll-hidden');
	})
	$('.fb_modal__close').click(function(){
		$('html').removeClass('scroll-hidden');
		$(this).parent().parent().removeClass('on').addClass('off');
		$(".fb_modal__form").find("input[name='subject']").val(null);
		$(".fb_modal__form").find("input[name='direction']").val(null);
	})
	$('.modal').click(function(event){
		if(event.target == this) {
			$(this).removeClass('on').addClass('off');
			if($('.sidebar').hasClass('on') == false) {
				$('html').removeClass('scroll-hidden');
			}
		}
	});
	$('.imagemap .area .img').on({
		mouseover: function(){
			$(this).parent().addClass('active');
			$(this).parent().parent().addClass('hover');
		},
		mouseout: function(){
			$(this).parent().removeClass('active');
			$(this).parent().parent().removeClass('hover');
		}
	})
});